local function sel_emoji()
    local t = emoji_grapheme
    return t[math.random(#t)]
end

local list_grapheme = {}
for i, ln in ipairs(list_latin) do
    local s = string.gsub(ln, ' ', function() return sel_emoji()..sel_emoji() end)
    table.insert(list_grapheme, s)
    s = string.gsub(list_jp[i], utf8.charpattern:rep(5), function(c) return sel_emoji()..c end)
    table.insert(list_grapheme, s)
end

local function colorize(t, s)
    table.insert(t, '\27[38;2')
    local r = math.random(0, 255)
    local g = math.random(0, 255)
    local b = math.random(0, 255)
    table.insert(t, string.format(';%d;%d;%dm', r, g, b))
    table.insert(t, s)
    table.insert(t, '\27[39;49m')
end

local colored_latin = {}
for _, s in ipairs(list_latin) do
    local t = {}
    for i=1, #s do
        colorize(t, string.sub(s, i, i))
    end
    table.insert(colored_latin, table.concat(t))
end

local colored_jp = {}
for _, s in ipairs(list_jp) do
    local t = {}
    for ch in string.gmatch(s, utf8.charpattern) do
        colorize(t, ch)
    end
    table.insert(colored_jp, table.concat(t))
end

