local function get_rep_n(t)
    local sum = 0
    for _, v in ipairs(t) do
        sum = sum + #v
    end
    return math.ceil(1024 * 1024 * 5 / sum)
end

local function shuffle_rep(t)
    local newt = {}
    for i=1, get_rep_n(t) do
        for _, v in ipairs(t) do
            table.insert(newt, v)
        end
    end
    for i = #newt, 2, -1 do
        local j = math.random(i)
        newt[i], newt[j] = newt[j], newt[i]
    end
    return newt
end

return {
    {
        label = 'cat-a',
        payload = function() return shuffle_rep(list_latin) end
    },
    {
        label = 'cat-u',
        payload = function() return shuffle_rep(list_jp) end
    },
    {
        label = 'cat-g',
        payload = function() return shuffle_rep(list_grapheme) end
    },
    {
        label = 'ccat-a',
        payload = function() return shuffle_rep(colored_latin) end
    },
    {
        label = 'ccat-u',
        payload = function() return shuffle_rep(colored_jp) end
    },
}
